import axios from "axios";

const API_URL = "http://localhost:8080/api/posts/";

const getPosts = () => {
  try {
    return axios.get(API_URL);
  } catch (err) {
    console.log(err);
  }
};

const PostsService = {
  getPosts,
};

export default PostsService;
